import * as React from "react";
import "../css/management.css";
import NavBar from "../dynamic/NavBar";
import Accordion from "@mui/material/Accordion";
import AccordionSummary from "@mui/material/AccordionSummary";
import AccordionDetails from "@mui/material/AccordionDetails";
import Typography from "@mui/material/Typography";
import { Box } from "@mui/system";
import { Card } from "@mui/material";

function Management() {
  function FeedAccordion(props) {
    const accordionName = props.accordionName;
    const accordionContent = props.accordionContent;
    return (
      <div id="accordion">
        <Accordion sx={{ backgroundColor: "#03dac5" }}>
          <AccordionSummary aria-controls="panel1a-content" id="panel1a-header">
            <Typography
              variant="h4"
              sx={{ color: "black", fontFamily: "system", fontWeight: "bold" }}
            >
              {accordionName}
            </Typography>
          </AccordionSummary>
          <AccordionDetails sx={{ display: "flex", flexFlow: "column" }}>
            <Typography
              variant="h6"
              sx={{ marginTop: "25px", fontFamily: "system" }}
            >
              {accordionContent}
            </Typography>
          </AccordionDetails>
        </Accordion>
      </div>
    );
  }

  function ImageCard() {
    return (
      <div 
      id="managementCardContainer"
        style={{
          position:"relative",
          width: "95vw",
          height: "50vh",
        }}
      >
        <Card
        id =  "managementCard"
          style={{
            position:"absolute",
            display:"flex",
            
            textAlign:"center",
            backgroundColor: "black",
            width: "95vw",
          height: "50vh",
          }}
        >
          <div id="wallsBackground"></div>
          <Typography id = "wallsTypo" variant="h4" style={{filter: "drop-shadow(0 0 .99ch lightyellow)",width:"100%",position:"absolute",top:"50%", textAlign:"center" ,color:"white", zIndex:"4"}} >“Nu zidurile fac o școală, ci spiritul ce domnește într-însa” <br />
            - Regele Ferdinand -
          </Typography>
        </Card>
      </div>
    );
  }

  return (
    <div id="managementContainer">
      <NavBar />
      <div id="secondManagementContainer">
        <ImageCard></ImageCard>
        <FeedAccordion accordionName="Regulament ordine interioara" />
        <FeedAccordion />
      </div>
    </div>
  );
}

export default Management;
